import React from 'react';
import './navbar.css';
import { Dropdown } from 'react-bootstrap'; // Importing Dropdown from react-bootstrap
import day_logo from '../../assets/day.png';
import light_person from '../../assets/person_light.png';

const Navbar = () => {
  return (
    <div className="container">
      <Dropdown>
        <Dropdown.Toggle as="img" src={light_person} className="toggle-icon" alt="profile" />

        <Dropdown.Menu>
          <Dropdown.Item href="">Profile</Dropdown.Item>
          <Dropdown.Item href="#action/2">Settings</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item href="#action/3">Logout</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>

      <img src={day_logo} alt="" className="toggle-icon" />
    </div>
  );
};

export default Navbar;
